import React from "react";
import styled from "styled-components";
const Menu = () => {
  const Menu = styled.div`
    position: absolute;
    background-color: red;
    width: 100vh;
    height: 100%;
  `;
  return (
    <>
      <Menu></Menu>
    </>
  );
};

export default Menu;
